import React, {useState, useEffect} from "react";
import "./styles.css";

let data = "";
let display = false;

export default class page2 extends React.Component {
	getData = () => {
		console.log("here");
		display = !display;
	    fetch("/api")
	      .then(res => res.json())
	      .then(
	        (result) => {
	          data = result.message;
	          console.log("made it here");
	        }
	      )
	  }
  render() {
    return (
      <div>
        <h1>{!data ? "Loading..." : data}</h1>
        <button onClick={this.getData}>get data</button>
        <p>{display && "hello"}</p>
      </div>
    );
  }
}
